import React, { Component } from 'react';
import axios from 'axios';
import '../../Contact/Contact.css';
import './mantain.css';

class Mantain extends Component {
    constructor(props) {
        super(props);
        this.state = {

        }
    }

    render() {
        return (
            <div>
                <form className="contact-form">
                    <div className="row">
                        <div className="form-group col-md-12">
                            <div className="row">
                                <div className="col-md-4">
                                    <h3>Selecciona el tipo de Agua de tú Pecera: </h3>
                                    <div className="row">
                                        <div className="col-md-6">
                                            <label>
                                                <input type="radio" name="contact-name" className="form-control" value='1' checked={this.props.water==='1'} onChange={this.props.onChangeWater} /> Dulce
                                                <img src="../images/accessories-bg.png" alt="water photo" />
                                            </label>
                                        </div>
                                        <div className="col-md-6">
                                            <input type="radio" name="contact-name" className="form-control" value='2' checked={this.props.water==='2'} onChange={this.props.onChangeWater} /> Salada
                                        </div>
                                    </div>
                                </div>
                                <div className="col-md-2"></div>
                                <div className="col-md-6">
                                    <h3>Ingresa la capacidad de tú Pecera en Litros: </h3><br /><br />
                                    <input type="number" name="contact-email" className="form-control" id="input_email" value={this.props.liters} onChange={this.props.onChangeLiters} placeholder="Litros de la Pecera *" required/>
                                </div>
                            </div>
                        </div>
                    </div>
                </form>
                <h3>Ingresa tus Datos: </h3>
            </div>
        );
    }
}

export default Mantain;
